import React from 'react';

const Navbar = ({filterItem, navItem}) => {
 return (
  <>
        <nav className='navbar'>
            {navItem.map((currElem) => {
                return(
                    <div>
                    <button 
                        className='navBtn' 
                        onClick={() => filterItem(currElem)}>
                        <span>{currElem}</span>
                    </button>
                    <i className='fas fa-cart-arrow-down'></i>
                    </div>
                )
               })
            }
        </nav>
</>
 ) 
}

export default Navbar;
